function cursos(){
    return(
        <div className="container">
            <h4>Courses</h4>
            <div className="row">
                <div className="col-6 col-sm-12">
                    <div>
                        <span>Imagen del curso</span>
                        <div>Texto del curso</div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default cursos;
